import React from 'react'

export function getList() {
  return fetch('https://goweather.herokuapp.com/weather/paris')
    .then(data => data.json())
}
const List =({list})=>  (
    <ul>
      {list.map((item)=>(
        <Item item={item}/>
      ))}
  </ul>
  )

const Item = ({item})=>(
<li>

  <span>{item.temperature}</span>
  <span>{item.wind}</span>
  <span>{item.description}</span>
</li>
);


export default List;
